INSERT INTO `english` (`id`, `level`, `value`) VALUES
(14, 3, 'But instead of giving it back, Pinocchio put it on his own head, which was half swallowed up in it. At that unexpected trick, Geppetto became very sad and downcast, more so than he had ever been before. "Pinocchio, you wicked boy!" he cried out. "You are not yet finished, and you start out by being impudent to your poor old father. Very bad, my son, very bad!" And he wiped away a tear.'),
(15, 3, 'The legs and feet still had to be made. As soon as they were done, Geppetto felt a sharp kick on the tip of his nose. "I deserve it!" he said to himself. "I should have thought of this before I made him. Now it''s too late!" He took hold of the Marionette under the arms and put him on the floor to teach him to walk.'),
(16, 3, 'Pinocchio''s legs were so stiff that he could not move them, and Geppetto held his hand and showed him how to put out one foot after the other. When his legs were limbered up, Pinocchio started walking by himself and ran all around the room. He came to the open door, and with one leap he was out into the street. Away he flew!'),
(17, 2, 'After the eyes, Geppetto made the nose, which began to stretch as soon as finished. It stretched and stretched and stretched till it became so long, it seemed endless. Poor Geppetto kept cutting it and cutting it, but the more he cut, the longer grew that impertinent nose. In despair he let it alone. Next he made the mouth.'),
(18, 2, 'After choosing the name for his Marionette, Geppetto set seriously to work to make the hair, the forehead, the eyes. Fancy his surprise when he noticed that these eyes moved and then stared fixedly at him. Geppetto, seeing this, felt insulted and said in a grieved tone: "Ugly wooden eyes, why do you stare so?" There was no answer.'),
(19, 2, 'In that very instant, a loud knock sounded on the door. "Come in," said the carpenter, not having an atom of strength left with which to stand up. At the words, the door opened and a dapper little old man came in. His name was Geppetto, but to the boys of the neighborhood he was Polendina, on account of the wig he always wore which was just the color of yellow corn.'),
(20, 1, 'With these words, he grabbed the log with both hands and started to knock it about unmercifully. He threw it to the floor, against the walls of the room, and even up to the ceiling. He listened for the tiny voice to moan and cry. He waited two minutes - nothing; five minutes - nothing; ten minutes - nothing.'),
(21, 1, 'What a look of surprise shone on Mastro Cherry''s face! His funny face became still funnier. He turned frightened eyes about the room to find out where that wee, little voice had come from and he saw no one! He looked under the bench - no one! He peeped inside the closet - no one! He searched among the shavings - no one! He opened the door to look up and down the street - and still no one!'),
(22, 1, 'I do not know how this really happened, yet the fact remains that one fine day this piece of wood found itself in the shop of an old carpenter. His real name was Mastro Antonio, but everyone called him Mastro Cherry, for the tip of his nose was so round and red and shiny that it looked like a ripe cherry.'),
(23, 1, 'Ah, that is in the family, dear, that is in the family. And there was also, I remember, a clergyman who wanted to be a lunatic, or a lunatic who wanted to be a clergyman, I forget which, but I know the Court of Chancery investigated the matter, and decided that he was quite sane. And I saw him afterwards at poor Lord Plumstead''s with straws in his hair, or something very odd about him. I can''t recall what. I often regret, Lady Caroline, that dear Lady Cecilia never lived to see her son get the title.'),
(24, 3, 'Since the days of Adam, there has been hardly a mischief done in this world but a woman has been at the bottom of it. Ever since ours was a family, and that must be very NEAR Adam''s time, so old, noble, and illustrious are the Barrys, as everybody knows, women have played a mighty part with the destinies of our race. I presume that there is no gentleman in Europe that has not heard of the house of Barry of Barryogue, of the kingdom of Ireland, than which a more famous name is not to be found in Gwillim or D''Hozier; and though, as a man of the world, I have learned to despise heartily the claims of some PRETENDERS.'),
(25, 3, 'She was the daughter of Sonoo, a Hill-man, and Jadeh his wife. One year their maize failed, and two bears spent the night in their only poppy-field just above the Sutlej Valley on the Kotgarth side; so, next season, they turned Christian, and brought their baby to the Mission to be baptized. The Kotgarth Chaplain christened her Elizabeth, and "Lispeth" is the Hill or pahari pronunciation. Later, cholera came into the Kotgarth Valley and carried off Sonoo and Jadeh, and Lispeth became half-servant, half-companion to the wife of the then Chaplain of Kotgarth. This was after the reign of the Moravian missionaries, but before Kotgarth had quite forgotten her title of "Mistress of the Northern Hills."'),
(26, 2, 'It was at a love-spinning that I saw Kester first. And if, in these new-fangled days, when strange inventions crowd upon us, when I hear tell there is even a machine coming into use in some parts of the country for reaping and mowing, if those that mayhappen will read this don''t know what a love-spinning was, they shall hear in good time. But though it was Jancis Beguildy''s love-spinning, she being three-and-twenty at that time and I being two years less, yet that is not the beginning of the story I have set out to tell.'),
(27, 2, 'He was an inch, perhaps two, under six feet, powerfully built, and he advanced straight at you with a slight stoop of the shoulders, head forward, and a fixed from-under stare which made you think of a charging bull. His voice was deep, loud, and his manner displayed a kind of dogged self-assertion which had nothing aggressive in it. It seemed a necessity, and it was directed apparently as much at himself as at anybody else. He was spotlessly neat, apparelled in immaculate white from shoes to hat, and in the various Eastern ports where he got his living as ship-chandler''s water-clerk he was very popular.'),
(28, 1, 'There was movement at the station, for the word had passed around that the colt from old Regret had got away, and had joined the wild bush horses - he was worth a thousand pound, so all the cracks had gathered to the fray. All the tried and noted riders from the stations near and far had mustered at the homestead overnight, for the bushmen love hard riding where the wild bush horses are, and the stock-horse snuffs the battle with delight.'),
(29, 3, 'To be, or not to be, that is the question: Whether ''tis nobler in the mind to suffer The slings and arrows of outrageous fortune Or to take arms against a sea of troubles, And by opposing end them? To die, to sleep, No more; and by a sleep to say we end The heartache, and the thousand natural shocks That flesh is heir to, ''tis a consummation Devoutly to be wish''d. To die, to sleep; To sleep! perchance to dream: ay, there''s the rub; For in that sleep of death what dreams may come, When we have shuffled off this mortal coil, Must give us pause: there''s the respect That makes calamity of so long life.'),
(30, 2, 'Egbert Ramsaran kept cows. In itself, there was nothing strange about this: most of the people who lived in the neighbourhood reared a few domestic animals. What was strange, however, was that Egbert Ramsaran had no real need of his cows. In keeping them, he disobeyed an unwritten though very powerful law: that the rich man, outgrowing his peasant status, bought his milk from others. It was a symbol of progress, practical, moral and aesthetic. His son was accosted on the street by the neighbours. ''But Mister Wilbert, tell me why your father does keep he own cow for? Why he so stubborn and hard-hearted for?'''),
(31, 1, '"Harvest is ended and summer is gone," quoted Anne Shirley, gazing across the shorn fields dreamily. She and Diana Barry had been picking apples in the Green Gables orchard, but were now resting from their labors in a sunny corner, where airy fleets of thistledown drifted by on the wings of a wind that was still summer-sweet with the incense of ferns in the Haunted Wood. But everything in the landscape around them spoke of autumn.'),
(32, 2, 'No one who had ever seen Catherine Morland in her infancy would have supposed her born to be an heroine. Her situation in life, the character of her father and mother, her own person and disposition, were all equally against her. Her father was a clergyman, without being neglected, or poor, and a very respectable man, though his name was Richard, and he had never been handsome. He had a considerable independence besides two good livings, and he was not in the least addicted to locking up his daughters. Her mother was a woman of useful plain sense, with a good temper, and, what is more remarkable, with a good constitution.'),
