INSERT INTO `punjabi` (`id`, `level`, `value`) VALUES
(1, 1, 'Punjab (Listeni/pʌnˈdʒɑːb/) is a state in North India, forming part of the larger Punjab region. The state is bordered by the Indian states of Jammu and Kashmir to the north, Himachal Pradesh to the east, Haryana to the south and southeast, Rajasthan to the southwest, and the Pakistani province of Punjab to the west. The state capital is located in Chandigarh, a Union Territory and also the capital of the neighbouring state of Haryana.'),
(2, 3, 'Agriculture is the largest industry in Punjab.[4] Other major industries include the manufacturing of scientific instruments, agricultural goods, electrical goods, financial services, machine tools, textiles, sewing machines, sports goods, starch, tourism, fertilisers, bicycles, garments, and the processing of pine oil and sugar. Punjab also has the largest number of steel rolling mill plants in India, which are located in "Steel Town"—Mandi Gobindgarh in the Fatehgarh Sahib district. It is also known for the sports hub—Jalandhar'),
(3, 2, 'During the period when the epic Mahabharata was written, around 800–400 BCE, Punjab was known as Trigarta and ruled by Katoch kings.[10][11] The Indus Valley Civilization spanned much of the Punjab region with cities such as Rupar. The Vedic Civilization spread along the length of the Sarasvati River to cover most of northern India including Punjab. This civilisation shaped subsequent cultures in the Indian subcontinent. The Punjab region was conquered by many ancient empires including the Gandhara, Nandas, Mauryas, Shungas, Kushans, Guptas, Palas, Gurjara-Pratiharas and Hindu Shahis. The furthest eastern extent of Alexander the Great''s exploration was along the Indus River. Agriculture flourished and trading cities such as Jalandhar, Sangrur and Ludhiana grew in wealth.'),
(4, 3, 'Jahangir attempted to assert authority over the Sikhs by imprisoning Guru Har Gobind at Gwalior. He felt compelled to release him when he began to suffer premonitions of an early and gruesome death. The Guru refused to be released unless the dozens of Hindu princes imprisoned with him were also granted freedom, to which Jahangir agreed. Sikhism did not have any further issues with the Mughal Empire until the death of Jahangir in 1627. His successor, Shah Jahan "took offense" at Guru Har Gobind''s sovereignty and after a series of assaults on Amritsar forced the Sikhs to retreat to the Sivalik Hills.[14] Guru Har Gobind''s successor, Guru Har Rai maintained the guruship in the Sivalik Hills by defeating local attempts to seize Sikh land and taking a neutral role in the power struggle between Aurangzeb and Dara Shikoh for control of the Timurid dynasty. The ninth Guru, Guru Tegh Bahadur, moved the Sikh community to Anandpur and travelled extensively to visit and preach in Sikh communities in defiance of Mughal rule. He aided Kashmiri Pandits in avoiding conversion to Islam and was arrested and confronted by Aurangzeb. When offered a choice between conversion or death, he chose to die rather than compromise his principles and was executed.[15] Guru Gobind Singh assumed the guruship in 1675 and to avoid battles with Sivalik Hill Rajas moved the guruship to Paunta. He built a large fort to protect the city and garrisoned an army to protect it. The growing power of the Sikh community alarmed Sivalik Hill Rajas, who attempted to attack the city, but the Guru''s forces routed them at the Battle of Bhangani. He moved on to Anandpur and established the Khalsa, a collective army of baptised Sikhs, on 30 March 1699. The establishment of the Khalsa united the Sikh community against various Mughal-backed claimants to the guruship.'),
(5, 3, 'In 1701, a combined army composed of the Sivalik Hill Rajas and the Mughal army under Wazir Khan attacked Anandpur and, following a retreat by the Khalsa, were defeated by the Khalsa at the Battle of Muktsar. Banda Singh Bahadur was an ascetic who converted to Sikhism after meeting Guru Gobind Singh at Nanded. A short time before his death, Guru Gobind Singh ordered him to uproot Mughal rule in Punjab and gave him a letter that commanded all Sikhs to join him. After two years of gaining supporters, Banda Singh Bahadur initiated an agrarian uprising by breaking up the large estates of Zamindar families and distributing the land to the poor Sikh, Hindu and Muslim peasants who farmed the land.[17] Banda Singh Bahadur started his rebellion with the defeat of Mughal armies at Samana and Sadhaura and the rebellion culminated in the defeat of Sirhind. During the rebellion, Banda Singh Bahadur made a point of destroying the cities in which Mughals had been cruel to Sikhs, including executing Wazir Khan in revenge for the deaths of Guru Gobind Singh''s sons, Baba Zorawar Singh and Baba Fateh Singh after the Sikh victory at Sirhind.[18] He ruled the territory between the Sutlej River and the Yamuna River, established a capital in the Himalayas at Lohgarh, and struck coinage in the names of Guru Nanak and Guru Gobind Singh'),
(6, 2, 'After his proclamation in 1801 as Maharajah, Ranjit Singh began the modernisation of the Punjab Army. All the Misl leaders who were affiliated with the Army had been nobility, usually with long and prestigious family histories in Punjab.[21][22] Ranjit Singh introduced several new commanders, some of them European, and a further 52,000 well-trained and equipped professional-grade irregulars with a significant multi-religious component. In addition, the army was equipped with field artillery, turning it into a premier fighting force.'),
(7, 2, 'As a condition of the peace treaty, some British troops, along with a resident political agent and other officials, were left in the Punjab to oversee the regency of Maharaja Dhalip Singh, a minor. The Sikh army was reduced greatly in size. In 1848, out-of-work Sikh troops in Multan revolted, and a British official was killed. Within a few months, the unrest had spread throughout the Punjab, and British troops once again invaded. The British prevailed in the Second Anglo-Sikh War, and under the Treaty of Lahore in 1849, the Punjab was annexed by the British East India Company, and Dhalip Singh was pensioned off. The Punjab became a province of British India, although a number of small states, most notably Patiala, Kapurthala, Faridkot, Nabha, and Jind, retained local rulers in subsidiary alliances with the British, with the rulers retaining their own internal sovereignty but recognising British suzerainty.');

